import  {FC} from 'react';
import Card from './Card';

const PackageSelector:FC<{title:string}> = (props) => {
    return (
       <Card>
           <div className="w-[278px] max-h-[278px] h-[278px]">
               <h1 className={'text-[36px] w-full  text-center'}>{props.title}</h1>
               <ul className="list-disc bg-red-400 ml-4 text-[20px]">
                   <li>2x Speakers</li>
                   <li>2x Moving Heads</li>
                   <li >1x Booth</li>
               </ul>

           </div>
       </Card>
    );
};

export default PackageSelector;
